import { Component, Input} from '@angular/core';
import { Skill } from 'src/app/DTO/skill.model';
import { SkillService } from 'src/app/services/skill.service';

@Component({
  selector: 'app-list-skills',
  templateUrl: './list-skills.component.html',
  styleUrls: ['./list-skills.component.scss']
})
export class ListSkillsComponent {
  @Input() title:string = "Liste de mes compétences";

  constructor(private SkillService:SkillService){

    // WITHOUT API
    let list = this.SkillService.getAllFromDB();

    // On fait ce que l'in veut du resultat
    list.forEach(element => {
      console.log(element.name);
    })

    // WITH API
    // this.SkillService.getAll().subscribe(resultat => {
    //   console.log(resultat);
    // })
  }
}

<section class="jumbotron text-center">
  <div class="container">
    <br />
    <h1 class="jumbotron-heading">{{title}}</h1>

  </div>
</section>

<div class="list-group">
  <a routerLink="#" class="list-group-item list-group-item-action" aria-disabled="">GESTION DE PROJET</a>
  <a routerLink="/skill" class="list-group-item list-group-item-action list-group-item-primary">TECHNOLOGIES BACK-END</a>
  <a href="#" class="list-group-item list-group-item-action list-group-item-secondary">TECHNOLOGIES FRONT-END</a>
  <a href="#" class="list-group-item list-group-item-action list-group-item-success">SAVOIR ETRE</a>
</div>
